import React, { Component } from 'react';

import PopularCategories from '../LandingPage/PopularCat/PopularCategories';
import Posts from '../LandingPage/Posts/Posts';
import Categories from '../LandingPage/Categories/Categories';
import Publicity from '../publicity/Publicity';

import './LandingPage.css';


class LandingPage extends Component {



    render() {
        return (
            <React.Fragment>

                <div className="container bg-danger">
                    <div className="row bg-dark">

                        <div className = "col-md-8 bg-warning"> 
                            <PopularCategories/>
                            <Posts/>       
                            <Categories/>

                        </div>

                        <div className = "publicidad col-md-4">    
                            <Publicity/>
                        </div>


                    </div>
                </div>


            </React.Fragment>
        );
    }
}


export default LandingPage;
